import React from 'react';

function Navigation() {
  return (
    <nav>
      <ul>
        <li><a href="/">Home</a></li>
        <li><a href="/about">About</a></li>
        <li><a href="/work">Work</a></li>
      </ul>
    </nav>
  );
}

export default Navigation;
